	(42, 1, 'DBM-SKET', 'SURAT PENGALIHAN PENGUASAAN TANAH', '[object Object]', '<p>Yang bertanda tangan di bawah ini masing-masing adalah :</p>\r\n\r\n<table cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:13px">I.</td>\r\n			<td style="width:52px">(Penjual)</td>\r\n			<td style="width:103px">Nama</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">ABDUL LATIF</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Tempat, Tgl Lahir</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">Enrekang, 20/05/1951</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Pekerjaan</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">Karyawan Swasta</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Alamat</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">SOTEK, Desa Sotek, Kecamatan Panajam</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="5">Untuk selanjutnya disebut PIHAK PERTAMA</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">II.</td>\r\n			<td style="width:52px">(Pembeli)</td>\r\n			<td style="width:103px">Nama</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">SRI DEWI, S.Pd.I</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Tempat Tgl Lahir</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">Gura, 13/05/1982</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Pekerjaan</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">Karyawan/Honorer</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:13px">&nbsp;</td>\r\n			<td style="width:52px">&nbsp;</td>\r\n			<td style="width:103px">Alamat</td>\r\n			<td style="width:10px">:</td>\r\n			<td style="width:296px">Gura, Desa Buntu Mondong</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="5">Untuk selanjutnya disebut PIHAK KEDUA</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>PIHAK PERTAMA dengan ini menyerahkan segala penguasaan yang dipunyai atau dapat dilakukan atas tanah tersebut berikut segala sesuatu yang terdapat di atas tanah kepada PIHAK KEDUA, dengan luas &plusmn; 9 M X 18 M = 162 M2 yang terletak di Gura, Dusun Gura, Desa Buntu Mondong, Kecamatan Buntu&nbsp; Batu, Kabupaten Enrekang dengan&nbsp; batas-batas sebagai berikut :</p>\r\n\r\n<table cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:119px">&nbsp; &nbsp; &nbsp; Sebelah Utara</td>\r\n			<td style="width:6px">:</td>\r\n			<td style="width:359px">Puskesmas Pembantu (PUSTU Desa Buntu Mondong</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:119px">&nbsp; &nbsp; &nbsp; Sebelah Timur</td>\r\n			<td style="width:6px">:</td>\r\n			<td style="width:359px">Rumah Arsin</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:119px">&nbsp; &nbsp; &nbsp; Sebelah Selatan</td>\r\n			<td style="width:6px">:</td>\r\n			<td style="width:359px">Rumah Nur Hidayah</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:119px">&nbsp; &nbsp; &nbsp; Sebelah Barat</td>\r\n			<td style="width:6px">:</td>\r\n			<td style="width:359px">Rumah Masaura</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>PIHAK KEDUA memberikan kompensasi ganti rugi kepada PIHAK PERTAMA sebesar Rp. 40.000.000,- ( Empat Pulu Juta Rupiah ) sehingga dengan pengalihan penguasasaan tanah ini PIHAK KEDUA menjadi pengganti PIHAK PERTAMA untuk memiliki, menguasai atau mengolah tanah tersebut sesuai dengan peruntukannya dan untuk bermohon hak yang sesuai dengan peraturan yang berlaku kepada instansi yang berwenang.<br />\r\nPIHAK PERTAMA menjamin kepada PIHAK KEDUA bahwa ia berhak sepenuhnya melakukan pengalihan penguasaan tanah ini, dan tidak dalam keadaan sengketa dengan pihak manapun ataupun tidak bersangkutan sebagai jaminan. Dan bersedia bertanggungjawab menurut hukum yang berlaku.<br />\r\n&nbsp; &nbsp; &nbsp;&nbsp;Demikian surat pengalihan penguasaan tanah ini dibuat dengan penuh kesadaran dan tanggungjawab, dalam keadaan sehat jasmani dan rohani tanpa tekanan dari siapapun, untuk di pergunakan sebagaimana mestinya. &nbsp;&nbsp;</p>', '<table cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>Gura, 24 Januari 2019</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PIHAK II ( PEMBELI )</td>\r\n			<td>PIHAK I ( PENJUAL )</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>(&nbsp;&nbsp; SRI DEWI, S. Pd. I.&nbsp;&nbsp; )</td>\r\n			<td>(&nbsp;&nbsp; ABDUL LATIF&nbsp;&nbsp; )</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">SAKSI-SAKSI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1. MUDDA</td>\r\n			<td>(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2. JUMADDU</td>\r\n			<td>(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>3. RAHMAT KARTOLO</td>\r\n			<td>(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; )</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Nomor :</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tanggal :</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">MENGETAHUI :</td>\r\n		</tr>\r\n		<tr>\r\n			<td>KEPALA DESA BUNTU MONDONG</td>\r\n			<td>KEPALA DESA GURA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>( KAISAR )</td>\r\n			<td>( ALI YANA )</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">Nomor :&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CAMAT BUNTU BATU</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tan