	(43, 1, 'DBM-SKET', 'SURAT KETERANGAN PERJANJIAN LISTIK', '[object Object]', '<p>Yang bertanda tangan di bawah ini :</p>\r\n\r\n<table cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:15px">I.</td>\r\n			<td style="width:100px">Nama</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">UDDING</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">Tempat/Tgl Lahir</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">Pasongken, 07 Juli 1980</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">NIK</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">7316100707800001</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">Alamat</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">Pasongken, Desa Buntu Mondong</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="4">Untuk selanjutnya disebut PIHAK PERTAMA (Penjual)</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">II.</td>\r\n			<td style="width:100px">Nama</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">Tempat/Tgl Lahir</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">NIK</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:15px">&nbsp;</td>\r\n			<td style="width:100px">Alamat</td>\r\n			<td style="width:12px">:</td>\r\n			<td style="width:353px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="4">Untuk selanjutnya disebut PIHAK KEDUA (Pembeli)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>PIHAK PERTAMA dengan ini telah membayar Rp 15.000.000,00 Kepada PIHAK KEDUA untuk penyelesaiyan Pemasangan KILOMETER LISTRIK Untuk 5&nbsp; UNIT Pada Tahun 2014,Di Pasongken Akan Tetapi Sampai&nbsp; Pada Tanggal 30 Bulan 8 Tahun 2018 Pelaksanaannya Juga Belum Selesai.<br />\r\nPIHAK PERTAMA yang merasa dirugikan akan hal ini Merasa Keberatan,dan memberikan jangka waktu 3 minggu terhitung dari hari ini (JUMAT 31 Agustus ) Untuk Mengembalikan Uang Tersebut Sebesar Rp,15.000.000,00 (Limas Belas Juta) dan jika ada pelanggaran perjanjian Maka PIHAK PERTAMA Berhak Melaporkan/Mengadukan kepada instansi yang Berwenang.<br />\r\n&nbsp; &nbsp; &nbsp;&nbsp;Demikian surat Perjanjian Pelaksanaan Pekerjaan ini &nbsp;dibuat dengan penuh kesadaran dan tanggung jawab, dalam keadan sehat jasmani dan rohani tanpa tekanan dari siapapun, untuk dipergunakan sebagaimana mestinya.</p>', '<table cellpadding="1" cellspacing="1" style="width:500px">\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp; &nbsp; &nbsp; Gura, 30 Agustus 2018</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p><strong>&nbsp; &nbsp; Pihak Pertama ()</strong></p>\r\n			</td>\r\n			<td><strong>&nbsp; Pihak Kedua (PeLaksana)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; UDDING</strong></td>\r\n			<td><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;YUSUF</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SAKSI-SAKSI :</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>1. HUSANG&nbsp; (&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;)</td>\r\n			<td>4. Juharman&nbsp; &nbsp;(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; )</td>\r\n		</tr>\r\n		<tr>\r\n			<td>2. AL Ihwal&nbsp; &nbsp;(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;)</td>\r\n			<td>5. Baharuddin(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; )</td>\r\n		</tr>\r\n		<tr>\r\n			<td>3. JASLIN&nbsp; &nbsp; &nbsp;(&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; )</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>No. Reg :</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Tanggal&nbsp; :</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2"><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MENGETAHUI :</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Kepala Desa Buntu Mondong</strong></td>\r\n			<td><strong>Kepala Desa Pasongken</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;KAISAR P.</strong></td>\r\n			<td><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; MUHARDAN</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', '[object Object]', '1', NULL, NULL);
